  CONSTRAINT `assets_ibfk_4` FOREIGN KEY (`AssetStatusID`) REFERENCES `assetstatus` (`AssetStatusID`),
  CONSTRAINT `assets_ibfk_5` FOREIGN KEY (`AssetUtilizationID`) REFERENCES `assetutilization` (`AssetUtilizationID`),
  CONSTRAINT `assets_ibfk_6` FOREIGN KEY (`LocationID`) REFERENCES `location` (`LocationID`),
  CONSTRAINT `assets_ibfk_7` FOREIGN KEY (`WarrantyContractID`) REFERENCES `warrantycontract` (`WarrantyContractID`),
  CONSTRAINT `assets_ibfk_8` FOREIGN KEY (`ManufacturerID`) REFERENCES `manufactures` (`ManufacturerID`),
  CONSTRAINT `assets_ibfk_9` FOREIGN KEY (`DonorID`) REFERENCES `donors` (`DonorID`)
